import React from "react";

import "./SearchPanel.scss";
import SearchBtns from "./SearchBtns/SearchBtns";
const SearchPanel = () => {
  return (
    <div className="Box">
      <input
        placeholder="Нажмите для ввода..."
        className="search"
        onChange={(event) => {
          alert(event.target.value);
        }}
      />
      <SearchBtns />
    </div>
  );
};

export default SearchPanel;
